import React from "react";

export default function Navbar() {
  return (
    <>
      <nav class="navbar bg-light">
        <div class="container-fluid">
          <a class="navbar-brand" href="#"></a>
        </div>
      </nav>

      <nav class="navbar bg-light">
        <div class="container-fluid">
          <span class="navbar-brand mb-0 h1">Navbar</span>
        </div>
      </nav>
    </>
  );
}
